            "why_study_springs": "Miks allikaid uurida?",
            "why_study_springs_text": "Puhas vesi on muutumas kogu maailmas üha napimaks ressursiks. Peame arvestama tõsiasjaga, et suurem osa veest (~97%) Maal on soolane ja magevesi vedelal kujul moodustab vaid umbes 0,8% kogu Maa veevarudest. Peamine osa mageveest esineb põhjaveena. Allikad on põhjavee loomulikud väljavoolud - seega olulisel kohal ka veeringluses. Eestis ja Lätis on olukord veevarudega hetkel veel üsna hea, kuid kliimamuutused ja üha intensiivsem inimtegevus (näiteks pestitsiidide ja väetiste kasutamine põllumajanduses, kraavitamine, kaevandamine jms) muudavad vee kättesaadavust ja kvaliteeti.",
