            "why_study_springs_text": "Tīrs ūdens kļūst par arvien retāku resursu visā pasaulē. Mums jāņem vērā fakts, ka lielākā daļa Zemes ūdeņu (~97%) ir sālsūdeņi, un saldūdens šķidrā agregātstāvoklī veido tikai aptuveni 0,8% no kopējiem pieejamiem ūdens resursiem uz Zemes. Lielākā daļa saldūdens resursu pieejami kā pazemes ūdeņi. Avoti ir dabiskas pazemes ūdeņu izplūdes vietas virszemē - līdz ar to tie ir svarīga ūdens aprites cikla daļa. Igaunijā un Latvijā situācija ar ūdens resursiem joprojām ir diezgan laba, taču klimata pārmaiņas un arvien intensīvāka antropogēnā ietekme (piemēram, pesticīdu un mēslošanas līdzekļu izmantošana lauksaimniecībā, meliorācija, derīgo izrakteņu ieguve utt.) negatīvi ietekmē mūsu ūdens resursu pieejamību un kvalitāti.",
